import React from 'react';
import './index.css';

const UserProfiles = () => {
  // Sample user data
  const users = [
    {
      id: 1,
      name: 'Leila',
      description: 'Learning',
      avatar: 'path_to_placeholder_image', // Replace with actual image path or URL
    },
    {
      id: 2,
      name: 'Ahmad',
      description: 'Loves Arabic literature',
      avatar: 'path_to_placeholder_image', // Replace with actual image path or URL
    },
    {
      id: 3,
      name: 'Noura',
      description: 'Interested in Arabic poetry',
      avatar: 'path_to_placeholder_image', // Replace with actual image path or URL
    },
  ];

  return (
    <div className="user-profiles-page">
      <h1>User Profiles</h1>
      <div className="user-profiles-container">
        {users.map((user) => (
          <div key={user.id} className="user-profile-card">
            <img src={user.avatar} alt={`${user.name}'s avatar`} />
            <div className="user-profile-details">
              <h2>{user.name}</h2>
              <p>{user.description}</p>
              <button>Follow</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default UserProfiles;
